import React from 'react';
import '../../App.css';
import Navbar from '../layout/Navbar';
const Home = () => {
  return (
    <div>
      <Navbar />
      <div className="container">
        <div className="py-4" >
          <p>
            <h2 className="py-4">Vehicle Maintenance And Repairing Services Web Portal</h2>
          </p>
       
        </div>
        
      </div>
      < img src="/images/homepage.avif"  className="img-responsive" alt="" id="home" style={{ maxWidth: '150%', height: 'a50uto', padding: 'auto' }} ></img>
    </div>
  );
};

export default Home;
